import Card from "../../UI/Card/Card";
import classes from './ServicesList.module.css'

function ServicesList(props){
    return(
        <li>
            <Card>
                <div>
                    <h1 className={classes.header}>{props.title}</h1>
                    <body>{props.operations}</body>
                </div>
            </Card>
        </li>
    );
}
